    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service (FWS),
    with the financial assistance of the Max McGraw Wildlife Foundation, undertook a
    study in two locations within the Devils Lake Wetland Management District (DLWMD)
    to determine the effects of mammalian predator management on waterfowl nesting success.
    Two 36 square mile sites were selected within the Prairie Pothole Region, which
    underwent intensive predator management through different types of trapping efforts.
    This report on the surveys in DLWMD explains the methods, results and discussion
    for both nest success and predator control.",nt"license_title": "License Not
